INSERT INTO public.product_description VALUES (1, 2, 1, 'Chất liệu nỉ chân cua là loại vải nỉ có độ dày vừa phải, có 2 mặt vải khác nhau giúp giữ được độ mềm mại bên trong đồng thời vẫn đứng form khi mặc. Chất vải này còn hỗ trợ và hạn chế nhăn khi mặc lên. Đồng thời chất vải này còn khá mát và phù hợp cả mùa nóng lẫn mùa lạnh.', '▶️ CHẤT LIỆU NỈ CHÂN CUA');
INSERT INTO public.product_description VALUES (2, 2, 2, 'Hình in được lấy cảm hứng từ phong cách Urban với kiểu sắp xếp chữ cực hiện đại, kiểu in mực nước được dập thẳng vào trong vải đem đến độ sắc nét và bền bỉ, không hề bong tróc dù cho có giặt qua nhiều lần.', '▶️ HÌNH IN HIỆN ĐẠI');
INSERT INTO public.product_description VALUES (3, 2, 3, 'Form Regular có độ rộng vừa phải, mặc lên người cực thoải mái, giúp anh em hạn chế được đa số khuyết điểm trên người. Đây cũng là form áo được ưa chuộng nhất 160STORE.', '▶️ FORM REGULAR');
INSERT INTO public.product_description VALUES (4, 3, 1, 'Chất liệu Jacquard ở áo có độ mềm mịn, giúp mặt trong khi chạm vào da vẫn dễ chịu. Mặt ngoài áo được dệt logo giả lông mang đến cảm giác ấm áp và thoải mái cho mùa thu đông sắp tới. ', '▶️ CHẤT LIỆU GIỮ ẤM');
INSERT INTO public.product_description VALUES (5, 3, 2, 'Được lấy cảm hứng từ những chiếc áo lông thú đắc đỏ, phần logo ICDN được trải khắp áo với các sợi poly tủa ra như những sợi lông mang đến cảm giác ấm áp và thoải mái. Hơn nữa, cách sắp xếp sợi lông theo đường logo còn làm tăng thêm tính thẩm mĩ và thời trang, giúp chiếc áo vẫn giữ được sự tinh tế nhất định mà không bị lố.', '▶️ THIẾT KẾ THỜI TRANG');
INSERT INTO public.product_description VALUES (6, 3, 3, 'Form quần áo đều là Regular đồng nhất giúp bộ quần áo khi mặc lên người giữ được form thẳng đứng từ trên xuống, không quá ôm cũng không quá rộng, mặc cực kỳ thoải mái.', '▶️ FORM ĐỒ THOẢI MÁI');
INSERT INTO public.product_description VALUES (7, 4, 1, 'Chất liệu Cotton là chất liệu điển hình, thường thấy nhất trong các mẫu áo thun hiện nay. Với định lượng vừa phải, chất liệu Cotton này mang đến cảm giác mềm mại và thoáng mát trên da, cực thích hợp khi mặc trong mùa hè này.', '▶️ CHẤT LIỆU COTTON');
INSERT INTO public.product_description VALUES (8, 4, 2, 'Hình thêu được thiết kế độc quyền bởi đội ngũ thiết kế thời trang của ICONDENIM với cách thêu lạ mắt như phong cách dùng 1 đường thêu để tạo nên vẻ lạ mắt và cuốn hút. Tone màu be rất riêng cũng góp phần tạo nên vẻ thời trang và phong cách cho chiếc áo.', '▶️ HÌNH THÊU LẠ MẮT');
INSERT INTO public.product_description VALUES (9, 4, 3, 'Form Regular có độ rộng vừa phải, mặc lên người cực thoải mái, giúp anh em hạn chế được đa số khuyết điểm trên người. Đây cũng là form áo được ưa chuộng nhất 160STORE.', '▶️ FORM REGULAR');
INSERT INTO public.product_description VALUES (10, 5, 1, 'Chất liệu Cotton là chất liệu điển hình, thường thấy nhất trong các mẫu áo thun hiện nay. Với trong lượng chỉ 220gsm, chất liệu Cotton này mang đến cảm giác mềm mại và thoáng mát trên da, cực thích hợp khi mặc trong mùa hè này.', '▶️ CHẤT LIỆU COTTON');
INSERT INTO public.product_description VALUES (11, 5, 2, 'Hình in được thiết kế độc quyền bởi đội ngũ thiết kế thời trang của ICONDENIM với kỹ thuật in ép nhiệt phủ màu cực đẹp, cực bền. Hình in vẽ về chú chó bull Pháp với những hình ảnh ngớ ngẩn và cool ngầu khiến cho áo trở nên sống động.', '▶️ HÌNH IN ĐẸP MẮT');
INSERT INTO public.product_description VALUES (12, 5, 3, 'Form Regular có độ rộng vừa phải, mặc lên người cực thoải mái, giúp anh em hạn chế được đa số khuyết điểm trên người. Đây cũng là form áo được ưa chuộng nhất 160STORE.', '▶️ FORM REGULAR');
INSERT INTO public.product_description VALUES (13, 6, 1, 'Chất liệu vải CVC, kết hợp giữa cotton và polyester, mang lại sự thoải mái và mềm mại của cotton, đồng thời tăng độ bền và khả năng chống nhăn của polyester. Đồng thời, chất liệu CVC cũng rất bền không bị co rút nhiều sau khi giặt và giữ màu sắc tốt, giúp áo luôn giữ được vẻ ngoài mới mẻ lâu dài.', '▶️ CHẤT LIỆU CVC');
INSERT INTO public.product_description VALUES (14, 6, 2, 'Chỉ với 2 gam màu trơn là Đen và Trắng nhưng thiết kế của chiếc polo này không hề nhàm chán. Với 2 viền tay áo đối màu tạo điểm nhấn cùng với bo tay trụ, mọi chú ý sẽ được đổ dồn vào phần vai giúp anh em trông mạnh mẽ hơn. Chi tiết chú chó chơi bóng chày được thêu tỉ mỉ ở ngực trái cực sắc nét.', '▶️ THIẾT KẾ TINH TẾ');
INSERT INTO public.product_description VALUES (15, 6, 3, 'Form Regular có độ rộng vừa phải, mặc lên người cực thoải mái, giúp anh em hạn chế được đa số khuyết điểm trên người. Đây cũng là form áo được ưa chuộng nhất 160STORE.', '▶️ FORM REGULAR');
INSERT INTO public.product_description VALUES (16, 7, 1, 'Chất liệu nỉ chân cua là loại vải nỉ có độ dày vừa phải, có 2 mặt vải khác nhau giúp giữ được độ mềm mại bên trong đồng thời vẫn đứng form khi mặc. Đồng thời chất vải này còn rất mát và thích hợp mặc vào mọi mùa.', '▶️ CHẤT VẢI NỈ CHÂN CUA');
INSERT INTO public.product_description VALUES (17, 7, 2, 'Form regular cho ống quần có độ suông vừa phải, giúp người mặc được thoải mái vận động hơn. Ngoài ra, form quần short ngang gối còn giúp quần che được một vài khuyết điểm ở chân cho ae.', '▶️ FORM REGULAR NGANG GỐI');
INSERT INTO public.product_description VALUES (21, 9, 2, 'Màu wash của quần jeans luôn là điểm nhấn đặc biệt nhất đối với mỗi chiếc jeans khác nhau. Màu grey wash là một gam màu cực kỳ mới lạ và sáng tạo, chưa xuất hiện nhiều ở các mã quần jeans khác.', '▶️ MÀU WASH MỚI LẠ');
INSERT INTO public.product_description VALUES (22, 9, 1, 'Chất liệu Denim nổi tiếng khi chính là chất liệu làm nên tất cả các loại quần jeans. Denim có tính ứng dụng rất cao khi có nhiều biến thể mỏng và dày khác nhau. Ở trên chiếc quần này, denim được dùng là chất liệu dày dặn khiến cho chiếc quần đứng form khi được mặc lên.', '▶️ CHẤT LIỆU DENIM');
INSERT INTO public.product_description VALUES (23, 9, 3, 'Form Slim có độ rộng phần đùi vừa phải và nhỏ dần về phía ống quần, đứng form, mặc lên người cực đẹp. Đây cũng là form quần được yêu thích nhất và bán chạy nhất 160STORE.', '▶️ FORM SLIM FIT');
INSERT INTO public.product_description VALUES (26, 21, 1, 'Chất liệu nỉ chân cua là loại vải nỉ có độ dày vừa phải, có 2 mặt vải khác nhau giúp giữ được độ mềm mại bên trong đồng thời vẫn đứng form khi mặc. Ngoài ra, chất vải này còn rất mát và thích hợp mặc vào mọi mùa.', '▶️ CHẤT VẢI NỈ CHÂN CUA');
INSERT INTO public.product_description VALUES (27, 21, 2, 'Form regular cho ống quần có độ suông vừa phải, giúp người mặc được thoải mái vận động hơn. Ngoài ra, form quần short ngang gối còn giúp quần che được một vài khuyết điểm ở chân cho ae.', '▶️ FORM REGULAR NGANG GỐI');
INSERT INTO public.product_description VALUES (28, 22, 1, 'Chất liệu Cotton là chất liệu điển hình, thường thấy nhất trong các mẫu áo thun hiện nay. Với định lượng vừa phải, chất liệu Cotton này mang đến cảm giác mềm mại và thoáng mát trên da, cực thích hợp khi mặc trong mùa hè này.', '▶️ CHẤT LIỆU COTTON');
INSERT INTO public.product_description VALUES (29, 22, 2, 'Toàn bộ áo được phủ lên với những đường kẻ dọc, giúp người mặc trông gọn gàng và tôn dáng hơn. Cổ áo và vai áo cũng được kẻ thêm các đường line lớn tạo điểm nhấn.', '▶️ THIẾT KẾ TÔN DÁNG');
INSERT INTO public.product_description VALUES (30, 22, 3, 'Form Regular có độ rộng vừa phải, mặc lên người cực thoải mái, giúp anh em hạn chế được đa số khuyết điểm trên người. Đây cũng là form áo được ưa chuộng nhất 160STORE.', '▶️ FORM REGULAR');
INSERT INTO public.product_description VALUES (31, 23, 1, 'Chất liệu siêu co giãn với 88% nylon và 12% pandex mang đến cảm giác mặc mát lạnh mà vẫn đảm bảo tính phục hồi form dáng sau khi giặt. Mặt vải với những lỗ thông hơi giúp người mặc hoạt động cả ngày vẫn cảm thấy thoáng mát.', '▶️ CHẤT LIỆU CO GIÃN');
INSERT INTO public.product_description VALUES (32, 23, 2, 'Thiết kế cực nam tính với những mảng màu trôi nổi tạo nên họa tiết Camo quân đội mang đầy cảm hứng. Có đến 2 gam màu là Trắng và Đen cho ae dễ dàng lựa chọn.', '▶️ HÌNH IN ĐẸP MẮT');
INSERT INTO public.product_description VALUES (33, 24, 1, 'Size S: Cân nặng: 53-60kg; Rộng ngực: 114cm; Ngang vai: 51cm; Dài áo: 68cm
INSERT INTO public.product_description VALUES (34, 24, 2, 'Chất vải nỉ chân cua mềm mại. Mặc mùa hè vẫn mát
INSERT INTO public.product_description VALUES (35, 25, 1, 'Mang vẻ ngoài hiện đại cùng tính thời trang cao, mẫu Áo Khoác Dù từ ICONDENIM đã sẵn sàng ''thuyết phục'' ae. Gây ấn tượng bởi hiệu ứng Colorblock trẻ trung kết hợp phong cách Raglan - bản phối đơn giản nhưng vẫn Ontrend từ những gam màu trung tính
INSERT INTO public.product_description VALUES (36, 26, 1, 'Chất liệu da sành điẹu, bên trong có lót vải, các đường dây khoá kéo bằng kim loại, chắc chắn và bền bỉ
INSERT INTO public.product_description VALUES (37, 27, 1, 'Chất Cotton mỏng nhẹ, mịn mát, thoải mái vận động trong những ngày nắng nóng
INSERT INTO public.product_description VALUES (38, 28, 1, 'Chất vải mềm, nhẹ, có độ rũ, cực thoáng mát
INSERT INTO public.product_description VALUES (39, 29, 1, 'Chất liệu vải Oxford có độ bền cao và dày dặn, mặc lên người rất đứng form. Ngoài ra, chất liệu này còn có độ bền màu tốt, giữ cho áo luôn mới mẻ sau nhiều lần giặt, không bám nhiều bụi, ít bị nhăn và hỗ trợ thấm hút mồ hôi.', '▶️ CHẤT LIỆU OXFORD');
INSERT INTO public.product_description VALUES (41, 30, 1, 'Chất liệu vải CVC, kết hợp giữa cotton và polyester, mang lại sự thoải mái và mềm mại của cotton, đồng thời tăng độ bền và khả năng chống nhăn của polyester. Đồng thời, áp dụng kỹ thuật cao để cho ra chất liệu double face còn giúp cho mặt trong áo trở nên mịn màng và êm da hơn mà vẫn giữ được mặt ngoài cứng cáp đứng form.', '▶️ CHẤT LIỆU CVC');
INSERT INTO public.product_description VALUES (42, 30, 2, 'Chỉ là một chiếc polo trơn nhưng được phối màu ở cổ áo để tạo điểm nhấn đặc biệt. Với pattern in dập vào trong vải, các đường màu đi cực kỳ chi tiết và sắc nét. Độ bám màu bền, không trôi khi giặt.', '▶️ THIẾT KẾ TINH TẾ');
INSERT INTO public.product_description VALUES (43, 30, 3, 'Form Regular có độ rộng vừa phải, mặc lên người cực thoải mái, giúp anh em hạn chế được đa số khuyết điểm trên người. Đây cũng là form áo được ưa chuộng nhất 160STORE.', '▶️ FORM REGULAR');
INSERT INTO public.product_description VALUES (40, 29, 2, 'Form dáng Slim được thiết kế ôm vừa vặn vào cơ thể, giúp tôn lên vóc dáng người mặc một cách tự nhiên và thanh lịch. Form dáng này không quá bó sát, nhưng vẫn giữ được sự gọn gàng và lịch lãm, phù hợp cho nhiều dịp khác nhau từ công sở đến các buổi hẹn hò, gặp gỡ bạn bè.', '▶️ FORM SLIM');
INSERT INTO public.product_description VALUES (44, 31, 1, 'Chất liệu vải CVC, kết hợp giữa cotton và polyester, mang lại sự thoải mái và mềm mại của cotton, đồng thời tăng độ bền và khả năng chống nhăn của polyester. Đồng thời, áp dụng kỹ thuật cao để cho ra chất liệu double face còn giúp cho mặt trong áo trở nên mịn màng và êm da hơn mà vẫn giữ được mặt ngoài cứng cáp đứng form.', '▶️ CHẤT LIỆU CVC');
INSERT INTO public.product_description VALUES (45, 31, 2, 'Chỉ là một chiếc polo trơn nhưng được phối màu ở cổ áo để tạo điểm nhấn đặc biệt. Với pattern in dập vào trong vải, các đường màu đi cực kỳ chi tiết và sắc nét. Độ bám màu bền, không trôi khi giặt.', '▶️ THIẾT KẾ TINH TẾ');
INSERT INTO public.product_description VALUES (46, 31, 3, 'Form Regular có độ rộng vừa phải, mặc lên người cực thoải mái, giúp anh em hạn chế được đa số khuyết điểm trên người. Đây cũng là form áo được ưa chuộng nhất 160STORE.', '▶️ FORM REGULAR');
INSERT INTO public.product_description VALUES (47, 32, 1, 'Chất vải quần tây điển hình giúp hạn chế nhăn, giúp người mặc lên dáng dễ dàng mà không cần phải ủi lại quá nhiều. Đồng thời có đến 2 gam màu tối nhưng không đơn giản: Xám Caro với nét chững chạc và đứng đắn hoặc Đen Sọc dọc với hiệu ứng hack chân dài hơn và cũng trẻ trung hơn.', '▶️ CHẤT LIỆU CHỐNG NHĂN');
INSERT INTO public.product_description VALUES (48, 32, 2, 'Form Slim có độ ôm nhẹ giúp ae thoải mái khi mặc, cực kỳ tôn dáng và chuẩn chỉnh, thích hợp với những trang phục cần sự trang trọng và lịch sự như công sở hay những buổi họp đối tác quan trọng cần sự chỉn chu.', '▶️ FORM SLIM');
INSERT INTO public.product_description VALUES (49, 33, 1, 'Chất vải quần tây điển hình giúp hạn chế nhăn, giúp người mặc lên dáng dễ dàng mà không cần phải ủi lại quá nhiều. Đồng thời có đến 2 gam màu tối nhưng không đơn giản: Xám Caro với nét chững chạc và đứng đắn hoặc Đen Sọc dọc với hiệu ứng hack chân dài hơn và cũng trẻ trung hơn.', '▶️ CHẤT LIỆU CHỐNG NHĂN');
