INSERT INTO public.product_description VALUES (51, 34, 1, 'Bảng màu siêu đẹp mặc đi đâu cũng ok 👍
INSERT INTO public.product_description VALUES (53, 36, 1, 'Sự kết hợp đa phong cách từ chất thể thao, năng động đến độ bụi bặm, ngầm nổi loạn của đường phố - thiết kế Quần Jeans Cargo vừa ra mắt, rất đáng để trải nghiệm! Mang chất liệu Denim dày dặn, bên trong lót lớp Cotton mềm mại, dễ chịu khi sử dụng, kỹ thuật wash chuyển màu giữa 2 tông Đen - Xám, nổi bật lên cá tính ''chất chơi'' theo một phong cách rất riêng, rất ICONDENIM. Các chi tiết túi hộp có nút bấm tiện lợi, phần bo ống chân vừa vặn có thể dễ dàng tự điều chỉnh bằng khoá kéo kim loại bền bỉ, mang tính ứng dụng cao trong mọi tình huống. Nhớ ''Zoom'' cận cảnh em này để thấy độ Chất😎', '𝐈𝐂𝐎𝐍𝐃𝐄𝐍𝐈𝐌| 𝐐𝐮ầ𝐧 𝐉𝐞𝐚𝐧𝐬 𝐂𝐚𝐫𝐠𝐨 𝐈𝐂𝐎𝐍𝐃𝐄𝐍𝐈𝐌 𝐃𝐚𝐫𝐤 𝐆𝐫𝐚𝐲');
INSERT INTO public.product_description VALUES (54, 37, 1, 'Mẫu Jeans gam màu xanh đậm với hiệu ứng wash sáng và cào rách cực bụi bặm.
INSERT INTO public.product_description VALUES (55, 38, 1, '<ul><li>Kỹ thuật Laser chất lượng cao tạo điểm nhấn độc đáo cho sản phẩm.</li><li>Chất liệu Denim dày dặn, hiệu ứng wash bền màu, đảm bảo chất lượng và sự bền bỉ.</li><li>Thiết kế Form Regular phù hợp với nhiều dáng người, mang đến cảm giác thoải mái khi mặc.</li><li>Short Jeans mới nhất đã được ra mắt với nhiều màu sắc và size đa dạng để lựa chọn.</li><li>Hãy thử nghiệm và cập nhật phong cách thời trang của bạn với mẫu Short Jeans độc đáo này.</li><li>Đặt hàng ngay để trải nghiệm sự tươi mới và trẻ trung cho ngày hè sôi động.</li></ul>', '👖 Short Jeans mới - Trẻ trung và mới lạ với hoạ tiết Bandana phương Tây.');
INSERT INTO public.product_description VALUES (56, 40, 1, '<ul><li>Siêu phẩm Smart fit&nbsp;Jeans từ ICONDENIM&nbsp;</li><li>Hiệu ứng râu mèo giúp quần có thêm điểm nhấn</li><li>Form Smart fit&nbsp;rất đẹp, ôm và tôn dáng&nbsp;</li><li>Gam màu&nbsp;đen kèm kỹ thuật Waxed (hiệu ứng sáp)&nbsp;cực chất</li></ul>', 'Đặc điểm sản phẩm :');
INSERT INTO public.product_description VALUES (57, 41, 1, 'Chất liệu Seersucker được sản xuất một phần từ thiên nhiên mang đến sự lành tính, chất vải còn có độ bóng nhẹ tương tự như lụa. Ngoài ra, đặc trưng của Seersucker còn là sự mỏng nhẹ, mặc lên cực mát, rất thích hợp cho mùa hè này.', '▶️ CHẤT LIỆU SEERSUCKER');
INSERT INTO public.product_description VALUES (58, 41, 2, 'Để phục vụ đặc biệt cho mùa hè, họa tiết trên áo được in pattern đặc biệt xoắn xéo đầy ma mị, tôn lên tinh thần Tropical một cách mới lạ. Mỗi chiếc áo cũng sẽ có cách sắp xếp họa tiết khác nhau làm nên sự khác biệt cho mỗi chiếc.', '▶️ PATTERN ĐẶC BIỆT');
INSERT INTO public.product_description VALUES (59, 41, 3, 'Form Relaxed có độ rộng tốt, mặc lên người cực thoải mái, giúp anh em hạn chế được đa số khuyết điểm trên người. Form áo này còn phục vụ rất tốt cho việc mặc khoác ngoài để anh em tha hồ mix&match', '▶️ FORM RELAXED');
INSERT INTO public.product_description VALUES (52, 35, 1, '<span>
INSERT INTO public.product_description VALUES (60, 42, 1, 'Chất liệu Oxford là loại chất liệu được dùng trong áo sơ mi từ lâu đời. Chất vải cao cấp mang đến cho người mặc cảm giác đứng form chuẩn chỉnh.', '▶️ CHẤT LIỆU OXFORD');
INSERT INTO public.product_description VALUES (61, 42, 2, 'Sọc xám trên áo cực nhuyễn mang đến vẻ ngoài phóng khoáng, thanh lịch, chỉn chu khi cần. Tay áo được in 2 sọc ngang xám trắng tạo điểm nhấn nhẹ. Đường may và nút gài được chú trọng, cực chỉn chu.', '▶️ TỈ MỈ ĐẾN TỪNG CHI TIẾT');
INSERT INTO public.product_description VALUES (62, 42, 3, 'Form Regular không quá ôm, lên dáng người rất thoải mái. Đồng thời, form dáng này tạo nên được độ rộng vừa phải giúp hạn chế được khuyết điểm trên người', '▶️ FORM REGULAR');
INSERT INTO public.product_description VALUES (63, 43, 1, 'Chất liệu Viscose được sản xuất một phần từ thiên nhiên mang đến sự lành tính, chất vải còn có độ bóng nhẹ tương tự như lụa. Ngoài ra, đặc trưng của Viscose còn là sự mỏng nhẹ, mặc lên cực mát, rất thích hợp cho mùa hè này.', '▶️ CHẤT LIỆU MỎNG MÁT');
INSERT INTO public.product_description VALUES (64, 43, 2, 'Để phục vụ đặc biệt cho mùa hè, họa tiết trên áo được in pattern đặc biệt xoắn xéo đầy ma mị, tôn lên tinh thần Tropical một cách mới lạ. Mỗi chiếc áo cũng sẽ có cách sắp xếp họa tiết khác nhau làm nên sự khác biệt cho mỗi chiếc.', '▶️ PATTERN ĐẶC BIỆT');
INSERT INTO public.product_description VALUES (65, 43, 3, 'Form Relaxed có độ rộng tốt, mặc lên người cực thoải mái, giúp anh em hạn chế được đa số khuyết điểm trên người. Form áo này còn phục vụ rất tốt cho việc mặc khoác ngoài để anh em tha hồ mix&match', '▶️ FORM RELAXED');
INSERT INTO public.product_description VALUES (66, 44, 1, 'Chất liệu Bamboo là loại chất liệu mới được dùng trong áo sơ mi trong những năm gần đây. Chất vải mỏng mát mang đến cho người mặc cảm giác thư giãn, nhẹ nhàng. Sơ mi lên dáng có độ rủ nhẹ, cực đẹp.', '▶️ CHẤT LIỆU BAMBOO');
INSERT INTO public.product_description VALUES (67, 44, 2, 'Có đến 4 gam màu là Đen, Trắng, Xám và Nâu cho anh em tha hồ lựa chọn. Với những màu sắc trung tính này, rất dễ dàng để anh em có thể phối cho mình những bộ đồ đa dạng phong cách từ đi làm đến đi chơi và còn dễ dàng kết hợp với nhiều màu khác nhau nữa.', '▶️ BẢNG MÀU ĐA DẠNG');
INSERT INTO public.product_description VALUES (68, 44, 3, 'Form Slim có độ ôm nhẹ, lên người cực kỳ tôn dáng. Đồng thời, form Slim tạo được độ thẳng thóm khi mặc lên, tạo cảm giác cực kỳ chỉn chu và gọn gàng', '▶️ FORM SLIM');
INSERT INTO public.product_description VALUES (69, 45, 1, 'Chất liệu khaki được dùng cực kỳ dày dặn, khi mặc lên rất đứng form và hạn chế được đa số khuyết điểm trên chân. Ngoài ra, chất liệu còn được pha thêm với sợi spandex mang đến khả năng co dãn nhẹ, dễ mặc hơn. Thiết kế đơn giản với việc lược bỏ toàn bộ các chi tiết thừa, mang đến nét đẹp tối giản cho quần. Có đến 3 gam màu trung tính là Be, Xanh Đen và Đen cực dễ phối đồ.', '▶️ CHẤT LIỆU KHAKI');
INSERT INTO public.product_description VALUES (70, 45, 2, 'Form Slim có độ rộng phần đùi vừa phải và nhỏ dần về phía ống quần, đứng form, mặc lên người cực đẹp. Đây cũng là form quần được yêu thích nhất và bán chạy nhất 160STORE.', '▶️ FORM SLIM');
