INSERT INTO public.product_description VALUES (72, 46, 2, 'Form Slim có độ rộng phần đùi vừa phải và nhỏ dần về phía ống quần, đứng form, mặc lên người cực đẹp. Đây cũng là form quần được yêu thích nhất và bán chạy nhất 160STORE.', '▶️ FORM SLIM');
